import React from "react";
import { MapContainer, Marker, Tooltip, TileLayer } from "react-leaflet";
import { MapText } from "../styles/Map";
import L from "leaflet";

import markerIcon from "../assets/clef.svg";

const icon = new L.Icon({
  iconUrl: markerIcon,
  iconRetinaUrl: markerIcon,
  iconSize: [55, 95],
});

function Map() {
  return (
    <div className="container">
      <MapContainer
        center={[44.187239, 21.106507]}
        zoom={15}
        attributionControl={true}
        scrollWheelZoom={false}
      >
        <TileLayer url="https://tiles.stadiamaps.com/tiles/alidade_smooth/{z}/{x}/{y}{r}.png" />
        <Marker position={[44.187239, 21.106507]} icon={icon}>
            <Tooltip permanent>
              <MapText>
                Fahrradwerkstatt Flickschuh Hetzendorfer Stra√üe 81, 1120 Wien
              </MapText>
            </Tooltip>
          </Marker>
      </MapContainer>
    </div>
  );
}

export default Map;
